import React from 'react'

export default function DroneTelemetry() {

  const telemetry = {
    'Speed': '12mp',
    'Altitude': '400 ft'


  }


  return (
    <div className='flex'>

      <div>
        speed: {telemetry.Speed}
      </div>

      <div>
        Altitude: {telemetry.Altitude}
      </div>


    </div>
  )
}
